- input: "TEXT\x1CC00440610\x1C.TEXT\x1C\x1CF3A\x1CSeveral contributions reportable
    under the 48-hour rule were inadvertantly omitted on Form 6. These came in as
    ActBlue earmarked contributions. It is the sincere regret of the Treasurer that
    these items were omitted because we intended to show all of the support that was
    being received by Mr. Taylor during the last days of the campaign. We were very
    busy and did not examine the ActBlue contributions until after the election. There
    were 6 donors omitted from the 48-hour reports: John Amois, $1000; Ian Banwell,
    $1000; Mark Beck, $1000; Stuart Schnider, $1000; Stephen McLaughlin, $1000; and
    Howard Wheeler Jr., $2300. The report was amended to include an expense for stationery
    made by debit card at Office Depot for $36.45. "
